    function myFunc(uint _tempUint) public {
        uint localUint = 42;
        uint256 newUint = 1234; // uint256 == uint == 2 ^ 256; max uint
        uint8 smallestUint = 2; // 2 ^ 8 == 256 (from 0 to 255)

        localUint + 1;
        localUint - 1;
